import React from "react";

const Sidebar = (props) => {
  return (
    <>
      <section id="sidebar">
        <div className="container">
          <div className="row">
            div.col
            <i class="fa-solid fa-grip-lines text-white"></i>
          </div>
        </div>
      </section>
    </>
  );
};

export default Sidebar;
